import React from 'react';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import { makeStyles,Typography } from '@material-ui/core';
import LaptopChromebookRoundedIcon from '@material-ui/icons/LaptopChromebookRounded';

const UseStyles = makeStyles((theme) => ({
    title: {
        fontSize: '50px',
    },
}));

export default function home() {
    const classes = UseStyles();
    return (
        <div>
            <CssBaseline />
            <Typography variant="h1" className={classes.title} component="h2">
                Transform your Library <br />for the Digital Future
            </Typography>
            <Button
                variant="contained"
                color="primary"
                size="large"
                className={classes.button}
                startIcon={<LaptopChromebookRoundedIcon />}
            >
                Start now
            </Button>
        </div>
    );
}
